import React from 'react';
import SponsorsGrid from '../components/SponsorsGrid';
import SponsorContactForm from '../components/SponsorContactForm';

const SponsorsPage = () => (
  <div>
    <h2>Sponsors</h2>
    <SponsorsGrid />
    <SponsorContactForm />
  </div>
);

export default SponsorsPage;
